import React from 'react';
import '../styles/Air_Quality';

function Air_Quality() {
  return (
    <div>
    <h3>Air Quality</h3>
    <div className='air-quality'>
    <h3 className='air-quality-present'>72</h3>
    <div className='air-quality-no'>
        <div className='air-quality-high'>93</div>
        <div className='air-quality-low'>61</div>
    </div>
    </div>
    
    </div>
  )
}

export default Air_Quality
